043d\u0435 \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u0435\u0439\u0448\u0438\u0435 \u043f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0435 \u043d\u0435\u043a\u0440\u043e\u043f\u043e\u043b\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1769\" class=\"mw-redirect\" title=\"1769\">1769<\/a>&#160;\u2014 \u043e\u0442\u043b\u0438\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D0%BE%D0%BA%D0%BE%D0%BB\" title=\"\u041a\u043e\u043b\u043e\u043a\u043e\u043b\">\u043a\u043e\u043b\u043e\u043a\u043e\u043b<\/a> \u0434\u043b\u044f \u0447\u0430\u0441\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%B0%D1%81%D1%81%D0%BA%D0%B0%D1%8F_%D0%B1%D0%B0%D1%88%D0%BD%D1%8F_(%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0)\" class=\"mw-redirect\" title=\"\u0421\u043f\u0430\u0441\u0441\u043a\u0430\u044f \u0431\u0430\u0448\u043d\u044f (\u041c\u043e\u0441\u043a\u0432\u0430)\">\u0421\u043f\u0430\u0441\u0441\u043a\u043e\u0439 \u0431\u0430\u0448\u043d\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%9A%D1%80%D0%B5%D0%BC%D0%BB%D1%8C\" title=\"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u041a\u0440\u0435\u043c\u043b\u044c\">\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u041a\u0440\u0435\u043c\u043b\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1785\" class=\"mw-redirect\" title=\"1785\">1785<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043f\u0440\u043e\u0448\u043b\u0430 \u0437\u0430\u043a\u043b\u0430\u0434\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D0%BC_%D0%9F%D0%B0%D1%88%D0%BA%D0%BE%D0%B2%D0%B0\" title=\"\u0414\u043e\u043c \u041f\u0430\u0448\u043a\u043e\u0432\u0430\">\u0414\u043e\u043c\u0430 \u041f\u0430\u0448\u043a\u043e\u0432\u0430<\/a>, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043d\u044b\u043d\u0435 \u0440\u0430\u0441\u043f\u043e\u043b\u0430\u0433\u0430\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B1%D0%B8%D0%B1%D0%BB%D0%B8%D0%BE%D1%82%D0%B5%D0%BA%D0%B0\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0431\u0438\u0431\u043b\u0438\u043e\u0442\u0435\u043a\u0430\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0431\u0438\u0431\u043b\u0438\u043e\u0442\u0435\u043a\u0430<\/a>. \u041f\u0440\u0435\u0434\u043f\u043e\u043b\u0430\u0433\u0430\u0435\u0442\u0441\u044f, \u0447\u0442\u043e \u0430\u0432\u0442\u043e\u0440\u043e\u043c \u043f\u0440\u043e\u0435\u043a\u0442\u0430 \u044d\u0442\u043e\u0433\u043e \u0432\u044b\u0434\u0430\u044e\u0449\u0435\u0433\u043e\u0441\u044f \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a\u0430 \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u044b \u043a\u043b\u0430\u0441\u0441\u0438\u0446\u0438\u0437\u043c\u0430 \u0431\u044b\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B6%D0%B5%D0%BD%D0%BE%D0%B2,_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D0%B8%D0%B9_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0430\u0436\u0435\u043d\u043e\u0432, \u0412\u0430\u0441\u0438\u043b\u0438\u0439 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u0412.&#160;\u0418.&#160;\u0411\u0430\u0436\u0435\u043d\u043e\u0432<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1807\" class=\"mw-redirect\" title=\"1807\">1807<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B5%D0%BD%D0%B